import React from "react";
import CartBox from "../groups/CartBox";
export default function CartBlock() {
  return (
    <div
      className="row"
      style={{ position: "fixed", right: 0, top: 0, width: 150 }}
    >
      <div className="col-md">
        <CartBox></CartBox>
        <div className="counter">
          <p>
            <b>Total Robots: {}</b>
          </p>
        </div>
      </div>
    </div>
  );
}
